import React from 'react';
import PropTypes from 'prop-types';
import CardProduct from "../../component/CardProduct/CardProduct";

ExampleSource.propTypes = {
  
};

function ExampleSource(props) {

  function clickBuyProduct(item) {
    console.log(item);
  }

  return (
    <div className="Container">
      <div className="SubContainer">
        <div className="Layout">
          {listProduct.map((item, index) => {
            return (
              <CardProduct
                key={index}
                itemProduct={item}
                addCardClick={clickBuyProduct}
              />
            );
          })}
        </div>
        <div className="DataStructure">
          <p>
            import CardProduct from "../../component/CardProduct/CardProduct";
          </p>
          <p>
              //Khai báo hàm xử lí ở parent
              function clickBuyProduct(item)
          </p>
          <pre className="productData">
            {showDataExample("productData", listProduct)}
          </pre>
        </div>
      </div>
    </div>
  );
}

function showDataExample(id, data) {
  document.getElementsByClassName(id).innerText = data;
}
export default ExampleSource;

//Product
const listProduct = [
  {
    id: 1,
    productName: "ASUS TP550LA-CJ04",
    price: 25000000,
    discount: 0,
    isHot: false,
    imageUrl: require("../../assets/images/camera.jpg").default,
  },
  {
    id: 2,
    productName: "ASUS TP550LA-CJ04",
    price: 25000000,
    discount: 10,
    isHot: false,
    imageUrl: require("../../assets/images/camera.jpg").default,
  }
];

//End Product
